import React, { useState, useEffect } from 'react';
import '../styles/Navbar.css';

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);
  
  // Handle scroll effect
  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };
    
    window.addEventListener('scroll', handleScroll);
    
    // Clean up event listener
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);
  
  // Close menu when clicking outside
  useEffect(() => {
    const closeMenu = (e) => {
      if (menuOpen && !e.target.closest('.navbar-links') && !e.target.closest('.menu-toggle')) {
        setMenuOpen(false);
      }
    };
    
    document.addEventListener('click', closeMenu);
    
    return () => {
      document.removeEventListener('click', closeMenu);
    };
  }, [menuOpen]);
  
  // Close menu when pressing escape key
  useEffect(() => {
    const handleEscape = (e) => {
      if (e.key === 'Escape') {
        setMenuOpen(false);
      }
    };
    
    document.addEventListener('keydown', handleEscape);
    
    return () => {
      document.removeEventListener('keydown', handleEscape);
    };
  }, []);
  
  // Toggle mobile menu
  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="navbar-logo">
        üè† SwissHomes
      </div>
      
      <div 
        className={`menu-toggle ${menuOpen ? 'active' : ''}`} 
        onClick={toggleMenu}
        aria-label="Toggle navigation menu"
      >
        <span></span>
        <span></span>
        <span></span>
      </div>
      
      <ul className={`navbar-links ${menuOpen ? 'active' : ''}`}>
        <li><a href="#" onClick={() => setMenuOpen(false)}>Home</a></li>
        <li><a href="#" onClick={() => setMenuOpen(false)}>Buy a Home</a></li>
        <li><a href="#" onClick={() => setMenuOpen(false)}>Rent a Home</a></li>
        <li><a href="#" onClick={() => setMenuOpen(false)}>Sell Your Home</a></li>
        <li><a href="#" onClick={() => setMenuOpen(false)}>About</a></li>
        
        {/* Mobile-only login button */}
        <li className="navbar-login mobile-only">
          <a href="#" className="login-btn" onClick={() => setMenuOpen(false)}>Login / Sign Up</a>
        </li>
      </ul>
      
      {/* Desktop login button */}
      <div className="navbar-login desktop-only">
        <a href="#" className="login-btn">Login / Sign Up</a>
      </div>
    </nav>
  );
};

export default Navbar;
